import React, {useState} from 'react';
import './header.css';


const Header = (props) => {

    const Mudar_tema = () => {
        if (props.light_dark_theme == props.Theme_light){
            props.setLightDarkTheme(props.Theme_dark);
            props.setBackgroundHeader("header_theme_light");
        } else{
            props.setLightDarkTheme(props.Theme_light);
            props.setBackgroundHeader("header_theme_dark");
        }

    }

    return (
        <header className={props.background_header}>
            <div className="area-pesquisa">
                <div className='icons_1'>
                    <a href="#">
                        <img id="logo" 
                             src="/assets/future.png" 
                             alt="Logo" 
                             title="Logo-Marca"
                        />
                    </a>
                    <input id="input_pesquisar"
                           type='text' 
                           placeholder='Pesquisar'
                    />
                    <button id="button-search">
                        <img id="img-button" 
                             src="/assets/lupa.png" 
                             alt="Pesquisar" 
                             title="Pesquisar"
                        />
                    </button>
                </div>
            </div>
            <div className='area-user-config'>
                <div className='icons'>
                    <a href="#"
                       onClick={Mudar_tema}
                    >
                        <img id="config" 
                             src={props.light_dark_theme} 
                             alt="Config" 
                             title="Configurações"
                        />
                    </a>
                    <a href="#">
                        <img id="img-user" 
                             src="/assets/user_2.png" 
                             alt="Usuário" 
                             title="Usuário"
                        />
                    </a>
                </div>
            </div>
        </header>
    );
}

export default Header;
